import { Modal, Button } from 'react-bootstrap'; // Importa los componentes de modal de Bootstrap

const AgregarNodoModal = ({ show, handleClose }) => {
    return (
        <Modal show={show} onHide={handleClose}>
            <Modal.Header closeButton>
                <Modal.Title>Agregar Nodo</Modal.Title>
            </Modal.Header>
            <Modal.Body>
                {/* Contenido del modal */}
                {/* ... */}
            </Modal.Body>
            <Modal.Footer>
                <Button variant="secondary" onClick={handleClose}>Cerrar</Button>
                {/* Otros botones o acciones del modal */}
            </Modal.Footer>
        </Modal>
    );
};

export default AgregarNodoModal;
